import * as React from 'react';
import ReactDOM from 'react-dom';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Button from '@mui/material/Button';
import Typography from '@mui/material';
import '@fontsource/roboto/300.css';
import '@fontsource/roboto/400.css';
import '@fontsource/roboto/500.css';
import '@fontsource/roboto/700.css';

const Main = (_props) => {
  return (
    <section>
      <Box sx={{flexGrow:1}}>
        <AppBar position='static'>
          <Toolbar>
            <Typography variant="h1">CoderDojo 五反田</Typography>
          </Toolbar>
        </AppBar>
      </Box>
      <Box>
        <Typography>CoderDojo五反田は毎月第3土曜日に開催しています。</Typography>
        <img src={`${process.env.PUBLIC_URL}/images/sceen_offline.jpg`} style={{maxWidth:480}} />
      </Box>

      <Box>
        <Button variant="contained" href="https://coderdojo-gotanda.doorkeeper.jp/">
          参加する
        </Button>
      </Box>
    </section>
  );
};


ReactDOM.render(<Main />, document.querySelector('#root'));
